CREATE TABLE CIDADE (
    ID          INTEGER NOT NULL,
    NOMECIDADE                VARCHAR(50) NOT NULL,
    ESTADO                    CHAR(2),
    CODPAIS                   INTEGER NOT NULL,
    COD_SIAFI                 INTEGER,
    CID_MODIFICACAO_DATAHORA  TIMESTAMP DEFAULT CURRENT_TIMESTAMP NOT NULL,
    NFSE_PROVEDOR_ID          INTEGER
);
ALTER TABLE CIDADE ADD CONSTRAINT PK_CIDADE PRIMARY KEY (ID);
ALTER TABLE CIDADE ADD CONSTRAINT FK_CIDADE_ESTADO FOREIGN KEY (ESTADO) REFERENCES UF (UFSIGLA);
ALTER TABLE CIDADE ADD CONSTRAINT FK_CIDADE_PAIS FOREIGN KEY (CODPAIS) REFERENCES AUX_PAIS (ID) ON UPDATE CASCADE;

